// 여기에 코드를 작성하세요
export async function getFoods({ order = "createdAt", offset = 0, limit = 3 }) {
  const query = `order=${order}&offset=${offset}&limit=${limit}`;
  const res = await fetch(`https://learn.codeit.kr/1111/foods?${query}`);
  const body = await res.json();
  return body;
}
